  `telefono` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `celular` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `motivo_activo` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT 'Al Dia',
  `activo` tinyint(1) NOT NULL DEFAULT '1',
  `comunidad_id` bigint unsigned NOT NULL,
  PRIMARY KEY (`id`),
  KEY `direcciones_comunidad_id_foreign` (`comunidad_id`),
  CONSTRAINT `direcciones_comunidad_id_foreign` FOREIGN KEY (`comunidad_id`) REFERENCES `comunidades` (`id`)
